import React from 'react';
import '../../App.css';
import './SignUp.css';
import ImageSlider from "./../ImageSlider";
import './../Gallery.css';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';

const SignUp = () => {
  const slides0 = [
    { url: "myImages/sheep.jpg", title: "beach" },
    { url: "myImages/lake.webp", title: "boat" },
    { url: "myImages/rose.webp", title: "forest" },
  ];


  const containerStyles = {
    width: "635px",
    height: "500px",
    margin: "0 auto",
  };


  return (
    <div>
      <div className="my_photo" style={containerStyles}>
        <ImageSlider slides={slides0} />
      </div>
    <div className='my_iamge_text'>
  <Link to='https://www.instagram.com/shiva74o6/' > 
  <h4>Shiva <i class="fa-brands fa-instagram"></i></h4> 
  </Link>
  </div>



    </div>
  );
}

export default SignUp;
